import { Link } from 'react-router-dom';
import { getVenues } from '../controller/GetVenues';

export const Home = () => {
	const getVenuesManager = (e) => {
        getVenues();
    }

	return (
		<div className="Home">
			<Link to="/CreateVenuePage">
				<div className="btn">Create Venue</div>
			</Link>
			<div id="constant-list"></div>
		</div>
	);
};
